INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100101, 0, 1, 0, 0, 100101, 0, "ヒヨリ", "ひより", 0, 1, "2030/12/31 15:00:00", 2.295, 7, "2015/04/01 15:00:00", 200, 0, 100101, 450, "【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。", 1, 100101, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100201, 0, 2, 0, 0, 100201, 0, "ユイ", "ゆい", 0, 1, "2030/12/31 15:00:00", 2.27, 7, "2015/04/01 15:00:00", 800, 0, 100201, 450, "【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。", 7, 100201, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100301, 0, 1, 0, 0, 100301, 0, "レイ", "れい", 0, 1, "2030/12/31 15:00:00", 1.965, 7, "2015/04/01 15:00:00", 250, 0, 100301, 450, "【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n攻撃スキルやカウンターを駆使して前線を押し上げる。", 4, 100301, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100401, 0, 1, 0, 0, 100401, 0, "ミソギ", "みそぎ", 0, 1, "2030/12/31 15:00:00", 2.17, 13, "2015/04/01 15:00:00", 205, 0, 100401, 450, "【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。", 1, 100401, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100501, 0, 1, 0, 0, 100501, 0, "マツリ", "まつり", 0, 2, "2030/12/31 15:00:00", 2.125, 2, "2018/09/18 15:00:00", 185, 0, 100501, 450, "【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。", 2, 100501, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100601, 0, 2, 0, 0, 100601, 0, "アカリ", "あかり", 0, 2, "2030/12/31 15:00:00", 2.19, 14, "2015/04/01 15:00:00", 570, 0, 100601, 450, "【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。", 6, 100601, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100701, 0, 1, 0, 0, 100701, 0, "ミヤコ", "みやこ", 0, 2, "2030/12/31 15:00:00", 1.7, 14, "2015/04/01 15:00:00", 125, 0, 100701, 450, "【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。", 3, 100701, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100801, 0, 2, 0, 0, 100801, 0, "ユキ", "ゆき", 0, 2, "2030/12/31 15:00:00", 2.07, 12, "2015/04/01 15:00:00", 805, 0, 100801, 450, "【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。", 7, 100801, 21, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (100901, 0, 2, 0, 0, 100901, 0, "アンナ", "あんな", 0, 3, "2030/12/31 15:00:00", 2.25, 11, "2015/04/01 15:00:00", 440, 0, 100901, 450, "【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。", 5, 100901, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101001, 0, 2, 0, 0, 101001, 0, "マホ", "まほ", 0, 3, "2030/12/31 15:00:00", 2.27, 4, "2015/04/01 15:00:00", 795, 0, 101001, 450, "【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。", 7, 101001, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101101, 0, 1, 0, 0, 101101, 0, "リノ", "りの", 0, 3, "2030/12/31 15:00:00", 1.97, 6, "2015/04/01 15:00:00", 700, 0, 101101, 450, "【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。", 8, 101101, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101201, 0, 2, 0, 0, 101201, 0, "ハツネ", "はつね", 0, 3, "2030/12/31 15:00:00", 2.07, 9, "2015/04/01 15:00:00", 755, 0, 101201, 450, "【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。", 7, 101201, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101301, 0, 2, 0, 0, 101301, 0, "ナナカ", "ななか", 0, 2, "2030/12/31 15:00:00", 2.07, 9, "2018/11/19 15:00:00", 740, 0, 101301, 450, "【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。", 7, 101301, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101401, 0, 2, 0, 0, 101401, 0, "カスミ", "かすみ", 0, 3, "2030/12/31 15:00:00", 2.27, 9, "2019/02/28 12:00:00", 730, 0, 101401, 450, "【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。", 7, 101401, 21, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101501, 0, 2, 0, 0, 101501, 0, "ミサト", "みさと", 0, 2, "2030/12/31 15:00:00", 2.27, 9, "2015/04/01 15:00:00", 735, 0, 101501, 450, "【魔法】後衛で魔法キャラを支援する、みんなの先生。\nユニオンバーストのＨＰ回復＆魔防アップ、先頭キャラの\n継続ＨＰ回復スキルは、味方の耐久力を大幅に高める。", 7, 101501, 9, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101601, 0, 1, 0, 0, 101601, 0, "スズナ", "すずな", 0, 2, "2030/12/31 15:00:00", 1.97, 15, "2015/04/01 15:00:00", 705, 0, 101601, 450, "【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。", 8, 101601, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101701, 0, 1, 0, 0, 101701, 0, "カオリ", "かおり", 0, 2, "2030/12/31 15:00:00", 2.17, 4, "2015/04/01 15:00:00", 145, 0, 101701, 450, "【物理】最前衛で、累積スキルでダメージを稼ぐ南国娘。\nスキル「精神統一」を発動すると、カオリが攻撃する度に\n敵に効果が累積し、次のダメージがどんどん増えていく。", 1, 101701, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (101801, 0, 2, 0, 0, 101801, 0, "イオ", "いお", 0, 3, "2030/12/31 15:00:00", 2.6, 15, "2015/04/01 15:00:00", 715, 0, 101801, 450, "【魔法】後衛で、敵全体を誘惑するセクシー先生。\n敵のＴＰを奪うスキルでユニオンバースト発動を遅らせ、\n誘惑のユニオンバーストを放ち、戦場を大混乱に陥れる。", 5, 101801, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102001, 0, 1, 0, 0, 102001, 0, "ミミ", "みみ", 0, 2, "2030/12/31 15:00:00", 2.125, 13, "2015/04/01 15:00:00", 360, 0, 102001, 450, "【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。", 5, 102001, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102101, 0, 1, 0, 0, 102101, 0, "クルミ", "くるみ", 0, 1, "2030/12/31 15:00:00", 1.675, 3, "2015/04/01 15:00:00", 240, 0, 102101, 450, "【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。", 3, 102101, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102201, 0, 2, 0, 0, 102201, 0, "ヨリ", "より", 0, 1, "2030/12/31 15:00:00", 2.19, 14, "2015/04/01 15:00:00", 575, 0, 102201, 450, "【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。", 6, 102201, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102301, 0, 1, 0, 0, 102301, 0, "アヤネ", "あやね", 0, 2, "2030/12/31 15:00:00", 1.425, 3, "2015/04/01 15:00:00", 210, 0, 102301, 450, "【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。", 3, 102301, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102501, 0, 2, 0, 0, 102501, 0, "スズメ", "すずめ", 0, 1, "2030/12/31 15:00:00", 2.27, 3, "2015/04/01 15:00:00", 720, 0, 102501, 450, "【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。", 7, 102501, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102601, 0, 1, 0, 0, 102601, 0, "リン", "りん", 0, 2, "2030/12/31 15:00:00", 2.34, 3, "2015/04/01 15:00:00", 550, 0, 102601, 450, "【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。", 6, 102601, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102701, 0, 1, 0, 0, 102701, 0, "エリコ", "えりこ", 0, 2, "2030/12/31 15:00:00", 1.425, 11, "2015/04/01 15:00:00", 230, 0, 102701, 450, "【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで敵に\nとどめの一撃を放つ毎に、その攻撃力はさらに上昇する。", 3, 102701, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102801, 0, 1, 0, 0, 102801, 0, "サレン", "されん", 0, 3, "2030/12/31 15:00:00", 2.09, 3, "2015/04/01 15:00:00", 430, 0, 102801, 450, "【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。", 4, 102801, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (102901, 0, 1, 0, 0, 102901, 0, "ノゾミ", "のぞみ", 0, 3, "2030/12/31 15:00:00", 1.965, 10, "2015/04/01 15:00:00", 160, 0, 102901, 450, "【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。", 4, 102901, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103001, 0, 1, 0, 0, 103001, 0, "ニノン", "にのん", 0, 3, "2030/12/31 15:00:00", 2.25, 12, "2015/04/01 15:00:00", 415, 0, 103001, 450, "【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。", 5, 103001, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103101, 0, 1, 0, 0, 103101, 0, "シノブ", "しのぶ", 0, 2, "2030/12/31 15:00:00", 2.25, 14, "2015/04/01 15:00:00", 365, 0, 103101, 450, "【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。", 5, 103101, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103201, 0, 1, 0, 0, 103201, 0, "アキノ", "あきの", 0, 3, "2030/12/31 15:00:00", 2.125, 8, "2015/04/01 15:00:00", 180, 0, 103201, 450, "【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。", 5, 103201, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103301, 0, 1, 0, 0, 103301, 0, "マヒル", "まひる", 0, 2, "2030/12/31 15:00:00", 2.34, 5, "2015/04/01 15:00:00", 395, 0, 103301, 450, "【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。", 6, 103301, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103401, 0, 1, 0, 0, 103401, 0, "ユカリ", "ゆかり", 0, 1, "2030/12/31 15:00:00", 2.4, 8, "2015/04/01 15:00:00", 405, 0, 103401, 450, "【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。", 5, 103401, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103601, 0, 2, 0, 0, 103601, 0, "キョウカ", "きょうか", 0, 3, "2030/12/31 15:00:00", 2.07, 0, "2015/04/01 15:00:00", 810, 0, 103601, 450, "【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。", 7, 103601, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103701, 0, 1, 0, 0, 103701, 0, "トモ", "とも", 0, 3, "2030/12/31 15:00:00", 1.965, 2, "2015/04/01 15:00:00", 220, 0, 103701, 450, "【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。", 4, 103701, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (103801, 0, 1, 0, 0, 103801, 0, "シオリ", "しおり", 0, 2, "2030/12/31 15:00:00", 1.97, 5, "2015/04/01 15:00:00", 710, 0, 103801, 450, "【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。", 8, 103801, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104001, 0, 1, 0, 0, 104001, 0, "アオイ", "あおい", 0, 1, "2030/12/31 15:00:00", 1.97, 9, "2015/04/01 15:00:00", 785, 0, 104001, 450, "【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。", 8, 104001, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104201, 0, 2, 0, 0, 104201, 0, "チカ", "ちか", 0, 2, "2030/12/31 15:00:00", 2.27, 10, "2015/04/01 15:00:00", 790, 0, 104201, 450, "【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。", 7, 104201, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104301, 0, 1, 0, 0, 104301, 0, "マコト", "まこと", 0, 3, "2030/12/31 15:00:00", 2.125, 4, "2015/04/01 15:00:00", 165, 0, 104301, 450, "【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。", 5, 104301, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104401, 0, 2, 0, 0, 104401, 0, "イリヤ", "いりや", 0, 3, "2030/12/31 15:00:00", 1.425, 12, "2015/04/01 15:00:00", 425, 0, 104401, 450, "【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。", 3, 104401, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104501, 0, 1, 0, 0, 104501, 0, "クウカ", "くうか", 0, 2, "2030/12/31 15:00:00", 2.375, 12, "2015/04/01 15:00:00", 130, 0, 104501, 450, "【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。", 2, 104501, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104601, 0, 1, 0, 0, 104601, 0, "タマキ", "たまき", 0, 2, "2030/12/31 15:00:00", 2.25, 8, "2015/04/01 15:00:00", 215, 0, 104601, 450, "【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。", 2, 104601, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104701, 0, 1, 0, 0, 104701, 0, "ジュン", "じゅん", 0, 3, "2030/12/31 15:00:00", 2.125, 2, "2015/04/01 15:00:00", 135, 0, 104701, 450, "【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。", 5, 104701, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104801, 0, 1, 0, 0, 104801, 0, "ミフユ", "みふゆ", 0, 2, "2030/12/31 15:00:00", 2.19, 8, "2015/04/01 15:00:00", 420, 0, 104801, 450, "【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。", 6, 104801, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (104901, 0, 1, 0, 0, 104901, 0, "シズル", "しずる", 0, 3, "2030/12/31 15:00:00", 2.375, 6, "2015/04/01 15:00:00", 285, 0, 104901, 450, "【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。", 5, 104901, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105001, 0, 2, 0, 0, 105001, 0, "ミサキ", "みさき", 0, 1, "2030/12/31 15:00:00", 2.07, 15, "2015/04/01 15:00:00", 760, 0, 105001, 450, "【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。", 7, 105001, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105101, 0, 1, 0, 0, 105101, 0, "ミツキ", "みつき", 0, 2, "2030/12/31 15:00:00", 2.25, 11, "2015/04/01 15:00:00", 565, 0, 105101, 450, "【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。", 5, 105101, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105201, 0, 1, 0, 0, 105201, 0, "リマ", "りま", 0, 1, "2030/12/31 15:00:00", 2.215, 5, "2015/04/01 15:00:00", 105, 0, 105201, 450, "【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。", 4, 105201, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105301, 0, 1, 0, 0, 105301, 0, "モニカ", "もにか", 0, 3, "2030/12/31 15:00:00", 2.24, 12, "2015/04/01 15:00:00", 410, 0, 105301, 450, "【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。", 4, 105301, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105401, 0, 1, 0, 0, 105401, 0, "ツムギ", "つむぎ", 0, 2, "2030/12/31 15:00:00", 2.42, 10, "2015/04/01 15:00:00", 195, 0, 105401, 450, "【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。", 1, 105401, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105501, 0, 1, 0, 0, 105501, 0, "アユミ", "あゆみ", 0, 1, "2030/12/31 15:00:00", 2.34, 12, "2019/03/19 15:00:00", 510, 0, 105501, 450, "【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。", 48, 105501, 48, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105601, 0, 1, 0, 0, 105601, 0, "ルカ", "るか", 0, 3, "2030/12/31 15:00:00", 1.965, 2, "2018/11/03 19:00:00", 158, 0, 105601, 450, "【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。", 4, 105601, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105701, 0, 1, 0, 0, 105701, 0, "ジータ", "じーた", 0, 3, "2030/12/31 15:00:00", 1.965, 4, "2015/04/01 15:00:00", 245, 0, 170101, 450, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 4, 105701, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105801, 0, 1, 0, 0, 105801, 0, "ペコリーヌ", "ぺこりーぬ", 0, 1, "2030/12/31 15:00:00", 2.25, 1, "2015/04/01 15:00:00", 155, 0, 105801, 450, "【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。", 5, 105801, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (105901, 0, 1, 0, 0, 105901, 0, "コッコロ", "こっころ", 0, 1, "2030/12/31 15:00:00", 2.34, 1, "2015/04/01 15:00:00", 500, 0, 105901, 450, "【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。", 6, 105901, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106001, 0, 2, 0, 0, 106001, 0, "キャル", "きゃる", 0, 1, "2030/12/31 15:00:00", 2.07, 1, "2015/04/01 15:00:00", 750, 0, 106001, 450, "【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。", 7, 106001, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106101, 0, 1, 0, 0, 106101, 0, "ムイミ", "むいみ", 0, 3, "2024/07/03 18:59:59", 1.8, 7, "2024/06/30 12:00:00", 162, 0, 106101, 450, "【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。", 2, 106101, 2, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106301, 0, 1, 0, 0, 106301, 0, "アリサ", "ありさ", 0, 3, "2030/12/31 15:00:00", 1.97, 1, "2015/04/01 15:00:00", 625, 0, 106301, 450, "【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。", 8, 106301, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106401, 0, 1, 0, 0, 106401, 0, "シェフィ", "しぇふぃ", 0, 3, "2030/12/31 15:00:00", 1.84, 1, "2021/02/15 23:00:00", 368, 0, 106401, 450, "【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。", 4, 106401, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106501, 0, 1, 0, 0, 106501, 0, "カヤ", "かや", 0, 3, "2030/12/31 15:00:00", 2.17, 17, "2019/11/15 15:00:00", 168, 0, 106501, 450, "【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。", 1, 106501, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106601, 0, 1, 0, 0, 106601, 0, "イノリ", "いのり", 0, 3, "2030/12/31 15:00:00", 1.55, 17, "2020/06/17 15:00:00", 197, 0, 106601, 450, "【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。", 3, 106601, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106701, 0, 2, 0, 0, 106701, 0, "ホマレ", "ほまれ", 0, 3, "2024/07/03 18:59:59", 2.27, 17, "2024/06/30 12:00:00", 727, 0, 106701, 450, "【魔法】後衛から無窮の魔力で全てを支配する龍の首領。\n障壁となる敵を龍眼で捉え、多彩な補助系スキルで敵の\n魔法攻撃からの耐性を弱め、雷霆の一撃で灰燼に帰す。", 7, 106701, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106801, 0, 1, 0, 0, 106801, 0, "ラビリスタ", "らびりすた", 0, 3, "2024/07/03 18:59:59", 1.55, 6, "2024/06/30 12:00:00", 560, 0, 106801, 450, "【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。", 4, 106801, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (106901, 0, 1, 0, 0, 106901, 0, "カイザーインサイト", "かいざーいんさいと", 0, 3, "2030/12/31 15:00:00", 2.0, 1, "2022/11/15 15:00:00", 660, 0, 106901, 450, "【物理】後衛で、天の星を瞳に宿し、覇道を進む皇。\n権能を解放し敵全体のバリアと全ステータスアップ効果を\n解除し、耐久力ダウンと複数の広範囲攻撃で敵を滅する。", 45, 106901, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107001, 0, 2, 0, 0, 107001, 0, "ネネカ", "ねねか", 0, 3, "2024/07/03 18:59:59", 2.0, 1, "2024/06/30 12:00:00", 660, 0, 107001, 450, "【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。", 0, 107001, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107101, 0, 1, 0, 0, 107101, 0, "クリスティーナ", "くりすてぃーな", 0, 3, "2024/07/03 18:59:59", 2.0, 2, "2024/06/30 12:00:00", 290, 0, 107101, 450, "【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。", 4, 107101, 10, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107501, 0, 1, 0, 0, 107501, 0, "ペコリーヌ（サマー）", "ぺこりーぬ", 0, 3, "2024/06/26 11:59:59", 2.125, 1, "2024/06/21 12:00:00", 235, 0, 107501, 450, "【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。", 5, 107501, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107601, 0, 1, 0, 0, 107601, 0, "コッコロ（サマー）", "こっころ", 0, 1, "2030/12/31 15:00:00", 2.34, 1, "2020/06/19 15:00:00", 535, 0, 107601, 450, "【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。", 6, 107601, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107701, 0, 2, 0, 0, 107701, 0, "スズメ（サマー）", "すずめ", 0, 3, "2024/06/26 11:59:59", 2.07, 3, "2024/06/21 12:00:00", 775, 0, 107701, 450, "【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。", 7, 107701, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107801, 0, 2, 0, 0, 107801, 0, "キャル（サマー）", "きゃる", 0, 3, "2024/06/26 11:59:59", 1.92, 1, "2024/06/21 12:00:00", 780, 0, 107801, 450, "【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。", 7, 107801, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (107901, 0, 1, 0, 0, 107901, 0, "タマキ（サマー）", "たまき", 0, 3, "2024/06/26 11:59:59", 2.0, 8, "2024/06/21 12:00:00", 225, 0, 107901, 450, "【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。", 2, 107901, 2, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108001, 0, 1, 0, 0, 108001, 0, "ミフユ（サマー）", "みふゆ", 0, 1, "2030/12/31 15:00:00", 2.19, 8, "2020/07/20 15:00:00", 495, 0, 108001, 450, "【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。", 6, 108001, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108101, 0, 1, 0, 0, 108101, 0, "シノブ（ハロウィン）", "しのぶ", 0, 3, "2023/10/26 11:59:59", 1.55, 0, "2023/10/23 12:00:00", 440, 0, 108101, 450, "【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。", 3, 108101, 3, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108201, 0, 1, 0, 0, 108201, 0, "ミヤコ（ハロウィン）", "みやこ", 0, 1, "2030/12/31 15:00:00", 2.42, 0, "2020/09/23 15:00:00", 590, 0, 108201, 450, "【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。", 1, 108201, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108301, 0, 2, 0, 0, 108301, 0, "ミサキ（ハロウィン）", "みさき", 0, 3, "2023/10/26 11:59:59", 2.07, 15, "2023/10/23 12:00:00", 815, 0, 108301, 450, "【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。", 7, 108301, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108401, 0, 2, 0, 0, 108401, 0, "チカ（クリスマス）", "ちか", 0, 3, "2023/12/27 11:59:59", 2.27, 10, "2023/12/22 12:00:00", 770, 0, 108401, 450, "【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。", 7, 108401, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108501, 0, 1, 0, 0, 108501, 0, "クルミ（クリスマス）", "くるみ", 0, 1, "2030/12/31 15:00:00", 1.55, 15, "2020/11/24 15:00:00", 295, 0, 108501, 450, "【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。", 3, 108501, 3, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108601, 0, 1, 0, 0, 108601, 0, "アヤネ（クリスマス）", "あやね", 0, 3, "2023/12/27 11:59:59", 1.425, 10, "2023/12/22 12:00:00", 190, 0, 108601, 450, "【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。", 3, 108601, 3, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108701, 0, 1, 0, 0, 108701, 0, "ヒヨリ（ニューイヤー）", "ひより", 0, 3, "2024/03/18 11:59:59", 2.17, 7, "2024/03/11 12:00:00", 170, 0, 108701, 450, "【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。", 1, 108701, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108801, 0, 2, 0, 0, 108801, 0, "ユイ（ニューイヤー）", "ゆい", 0, 3, "2024/03/18 11:59:59", 2.27, 7, "2024/03/11 12:00:00", 745, 0, 108801, 450, "【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。", 7, 108801, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (108901, 0, 1, 0, 0, 108901, 0, "レイ（ニューイヤー）", "れい", 0, 1, "2030/12/31 15:00:00", 2.215, 7, "2020/12/22 15:00:00", 153, 0, 108901, 450, "【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。", 4, 108901, 22, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109001, 0, 1, 0, 0, 109001, 0, "エリコ（バレンタイン）", "えりこ", 0, 1, "2030/12/31 15:00:00", 1.9, 11, "2021/01/25 15:00:00", 187, 0, 109001, 450, "【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。", 3, 109001, 3, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109101, 0, 1, 0, 0, 109101, 0, "シズル（バレンタイン）", "しずる", 0, 3, "2024/01/26 11:59:59", 2.125, 7, "2024/01/22 12:00:00", 385, 0, 109101, 450, "【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。", 5, 109101, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109201, 0, 2, 0, 0, 109201, 0, "アン", "あん", 0, 3, "2030/12/31 15:00:00", 2.27, 6, "2019/03/31 12:00:00", 630, 0, 109201, 450, "【魔法】後衛で、英霊の召喚術を武器に戦うお姫様。\n味方に英霊の加護を付与するスキルによるサポーターと、\n高威力の魔法によるアタッカーの二つの役割を併せ持つ。", 7, 109201, 23, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109301, 0, 2, 0, 0, 109301, 0, "ルゥ", "るぅ", 0, 1, "2030/12/31 15:00:00", 2.27, 9, "2021/03/23 15:00:00", 640, 0, 109301, 450, "【魔法】後衛で、オメメちゃんと戦う、ノーテンキ少女。\nスキルで呼び出すオメメちゃんは敵の攻撃を防ぐほか、\nその数が多いほどユニオンバーストの威力を増加させる。", 7, 109301, 23, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109401, 0, 2, 0, 0, 109401, 0, "グレア", "ぐれあ", 0, 3, "2030/12/31 15:00:00", 2.27, 9, "2019/04/19 15:00:00", 525, 0, 109401, 450, "【魔法】中衛で、炎を操り敵を薙ぎ払う、竜人の少女。\n高い魔法攻撃力を生かした範囲攻撃を得意とする。\nまた、飛行能力を駆使して放つ突進攻撃も強力。", 1, 109401, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109501, 0, 2, 0, 0, 109501, 0, "クウカ（オーエド）", "くうか", 0, 3, "2030/12/31 15:00:00", 2.066, 12, "2019/04/30 12:00:00", 140, 0, 109501, 450, "【魔法】最前衛で、味方を鼓舞する着物姿のドＭ娘。\n味方の魔法攻撃力を高め、敵の魔法防御力を下げる事で、\n魔法パーティのサポート兼防御役として活躍する。", 7, 109501, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109601, 0, 1, 0, 0, 109601, 0, "ニノン（オーエド）", "にのん", 0, 3, "2030/12/31 15:00:00", 2.0, 12, "2019/05/17 15:00:00", 175, 0, 109601, 450, "【物理】最前衛で、忍法を駆使して敵と戦うクノイチ。\nユニオンバーストはクリティカル時のダメージを１．５倍\nにする特性を持ち、うまくかみ合った時の威力は抜群。", 2, 109601, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109701, 0, 1, 0, 0, 109701, 0, "レム", "れむ", 0, 3, "2020/11/21 14:59:59", 2.25, 9, "2020/11/10 12:00:00", 540, 0, 109701, 450, "【物理】中衛で、鬼の力で敵を粉砕する、双子の妹。\n回復スキルの他にも、温度を操るスキルを得意とし、\n敵を凍結させた上でユニオンバーストで薙ぎ払う。", 13, 109701, 24, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109801, 0, 2, 0, 0, 109801, 0, "ラム", "らむ", 1, 1, "2030/12/31 15:00:00", 2.5, 9, "2015/04/01 15:00:00", 545, 0, 109801, 450, "【魔法】中衛で、特殊能力で味方を補助する、双子の姉。\n相手の物理攻撃を見切って回避させる「千里眼」や、\n敵全体を束縛するユニオンバーストの補助は効果絶大。", 7, 109801, 24, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (109901, 0, 2, 0, 0, 109901, 0, "エミリア", "えみりあ", 0, 3, "2020/11/21 14:59:59", 2.27, 9, "2020/11/10 12:00:00", 725, 0, 109901, 450, "【魔法】後衛で、攻撃と回復をこなす、ハーフエルフ。\n高い魔力で攻撃魔法を繰り出して敵を蹴散らしつつ、\nユニオンバーストは瀕死の味方すらも瞬時に癒す。", 7, 109901, 23, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110001, 0, 1, 0, 0, 110001, 0, "スズナ（サマー）", "すずな", 0, 3, "2024/06/26 11:59:59", 1.82, 15, "2024/06/21 12:00:00", 705, 0, 110001, 450, "【物理】後衛で高威力の弓技を放つ夏のカリスマモデル。\nバトル中に放つ「サマーランウェイ♪」でＴＰを全回復\nして、発動後のユニオンバーストがクリティカルになる。", 8, 110001, 8, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110101, 0, 2, 0, 0, 110101, 0, "イオ（サマー）", "いお", 0, 1, "2030/12/31 15:00:00", 2.4, 15, "2021/05/18 15:00:00", 715, 0, 110101, 450, "【魔法】後衛で、敵の体力を奪い取る、夏の夜の先生。\nダメージを与えつつ味方を回復するスキルを複数持ち、\n攻守どちらの側でも高い能力を発揮する。", 5, 110101, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110201, 0, 0, 0, 0, 110201, 0, "ミサキ（サマー）", "みさき", 0, 1, "2030/12/31 15:00:00", 0.0, 15, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 7, 0, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110301, 0, 1, 0, 0, 110301, 0, "サレン（サマー）", "されん", 0, 3, "2024/06/26 11:59:59", 2.24, 3, "2024/06/21 12:00:00", 585, 0, 110301, 450, "【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。", 4, 110301, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110401, 0, 1, 0, 0, 110401, 0, "マコト（サマー）", "まこと", 0, 3, "2024/07/31 11:59:59", 2.125, 4, "2024/07/23 12:00:00", 180, 0, 110401, 450, "【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。", 5, 110401, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110501, 0, 1, 0, 0, 110501, 0, "カオリ（サマー）", "かおり", 0, 1, "2030/12/31 15:00:00", 2.42, 4, "2021/06/18 15:00:00", 425, 0, 110501, 450, "【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。", 1, 110501, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110601, 0, 2, 0, 0, 110601, 0, "マホ（サマー）", "まほ", 0, 3, "2024/07/31 11:59:59", 2.27, 4, "2024/07/23 12:00:00", 792, 0, 110601, 450, "【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。", 7, 110601, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110701, 0, 1, 0, 0, 110701, 0, "アオイ（編入生）", "あおい", 0, 3, "2030/12/31 15:00:00", 1.82, 4, "2019/09/03 21:00:00", 680, 0, 110701, 450, "【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。", 8, 110701, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110801, 0, 1, 0, 0, 110801, 0, "クロエ", "くろえ", 0, 3, "2030/12/31 15:00:00", 2.125, 2, "2019/09/16 15:00:00", 185, 0, 110801, 450, "【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。", 2, 110801, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (110901, 0, 1, 0, 0, 110901, 0, "チエル", "ちえる", 0, 3, "2030/12/31 15:00:00", 2.295, 2, "2020/04/15 15:00:00", 222, 0, 110901, 450, "【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。", 1, 110901, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111001, 0, 2, 0, 0, 111001, 0, "ユニ", "ゆに", 0, 3, "2030/12/31 15:00:00", 2.27, 2, "2020/03/31 12:00:00", 807, 0, 111001, 450, "【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。", 7, 111001, 26, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111101, 0, 2, 0, 0, 111101, 0, "キョウカ（ハロウィン）", "きょうか", 0, 3, "2023/10/26 11:59:59", 2.07, 13, "2023/10/23 12:00:00", 820, 0, 111101, 450, "【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。", 7, 111101, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111201, 0, 1, 0, 0, 111201, 0, "ミソギ（ハロウィン）", "みそぎ", 0, 1, "2030/12/31 15:00:00", 2.17, 13, "2021/08/16 15:00:00", 212, 0, 111201, 450, "【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。", 1, 111201, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111301, 0, 1, 0, 0, 111301, 0, "ミミ（ハロウィン）", "みみ", 0, 3, "2030/12/31 15:00:00", 2.0, 13, "2019/10/16 15:00:00", 365, 0, 111301, 450, "【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。", 5, 111301, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111401, 0, 2, 0, 0, 111401, 0, "ルナ", "るな", 0, 3, "2030/12/31 15:00:00", 1.87, 0, "2019/10/31 12:00:00", 765, 0, 111401, 450, "【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。", 7, 111401, 25, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111501, 0, 1, 0, 0, 111501, 0, "クリスティーナ（クリスマス）", "くりすてぃーな", 0, 3, "2023/12/27 11:59:59", 2.0, 13, "2023/12/22 12:00:00", 265, 0, 111501, 450, "【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。", 4, 111501, 10, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111601, 0, 1, 0, 0, 111601, 0, "ノゾミ（クリスマス）", "のぞみ", 0, 1, "2030/12/31 15:00:00", 2.24, 13, "2021/10/19 15:00:00", 418, 0, 111601, 450, "【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。", 4, 111601, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111701, 0, 2, 0, 0, 111701, 0, "イリヤ（クリスマス）", "いりや", 0, 3, "2030/12/31 15:00:00", 1.3, 13, "2019/12/20 15:00:00", 255, 0, 111701, 450, "【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。", 3, 111701, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111801, 0, 1, 0, 0, 111801, 0, "ペコリーヌ（ニューイヤー）", "ぺこりーぬ", 0, 3, "2024/01/31 11:59:59", 1.965, 13, "2024/01/26 12:00:00", 248, 0, 111801, 450, "【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。", 4, 111801, 22, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (111901, 0, 1, 0, 0, 111901, 0, "コッコロ（ニューイヤー）", "こっころ", 0, 3, "2024/03/18 11:59:59", 1.87, 1, "2024/03/11 12:00:00", 159, 0, 111901, 450, "【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。", 7, 111901, 23, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112001, 0, 2, 0, 0, 112001, 0, "キャル（ニューイヤー）", "きゃる", 0, 3, "2024/03/18 11:59:59", 2.07, 3, "2024/03/11 12:00:00", 690, 0, 112001, 450, "【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。", 7, 112001, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112101, 0, 2, 0, 0, 112101, 0, "スズメ（ニューイヤー）", "すずめ", 0, 1, "2030/12/31 15:00:00", 2.27, 1, "2021/11/16 15:00:00", 722, 0, 112101, 450, "【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。", 7, 112101, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112201, 0, 2, 0, 0, 112201, 0, "カスミ（マジカル）", "かすみ", 0, 3, "2030/12/31 15:00:00", 2.27, 9, "2020/01/31 12:00:00", 730, 0, 112201, 450, "【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。", 7, 112201, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112301, 0, 1, 0, 0, 112301, 0, "シオリ（マジカル）", "しおり", 0, 1, "2030/12/31 15:00:00", 1.97, 5, "2021/12/16 15:00:00", 712, 0, 112301, 450, "【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。", 8, 112301, 8, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112401, 0, 1, 0, 0, 112401, 0, "ウヅキ（デレマス）", "うづき", 0, 3, "2021/03/24 11:59:59", 2.24, 18, "2021/03/08 12:00:00", 370, 0, 112401, 450, "【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。", 4, 112401, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112501, 0, 1, 0, 0, 112501, 0, "リン（デレマス）", "りんでれます", 0, 3, "2021/03/24 11:59:59", 2.215, 18, "2021/03/08 12:00:00", 153, 0, 112501, 450, "【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。", 4, 112501, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112601, 0, 2, 0, 0, 112601, 0, "ミオ（デレマス）", "みお", 1, 1, "2030/12/31 15:00:00", 2.27, 18, "2015/04/01 15:00:00", 695, 0, 112601, 450, "【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。", 7, 112601, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112701, 0, 1, 0, 0, 112701, 0, "リン（レンジャー）", "りん", 0, 3, "2030/12/31 15:00:00", 2.19, 3, "2020/04/30 12:00:00", 422, 0, 112701, 450, "【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。", 6, 112701, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112801, 0, 1, 0, 0, 112801, 0, "マヒル（レンジャー）", "まひる", 0, 3, "2030/12/31 15:00:00", 2.19, 5, "2020/05/15 15:00:00", 390, 0, 112801, 450, "【物理】中衛で、多勢相手が十八番のまきばの戦士。\n相手を吹き飛ばすスキルを多用し敵の陣形を押し込む。\n範囲攻撃と混乱付与スキルを駆使し一気に殲滅する。", 6, 112801, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (112901, 0, 1, 0, 0, 112901, 0, "リノ（ワンダー）", "りの", 0, 3, "2030/12/31 15:00:00", 1.97, 6, "2020/06/03 19:00:00", 730, 0, 112901, 450, "【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。", 8, 112901, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113001, 0, 1, 0, 0, 113001, 0, "アユミ（ワンダー）", "あゆみ", 0, 1, "2030/12/31 15:00:00", 2.34, 12, "2020/05/31 12:00:00", 508, 0, 113001, 450, "【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。", 6, 113001, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113101, 0, 1, 0, 0, 113101, 0, "ルカ（サマー）", "るか", 0, 3, "2024/07/31 11:59:59", 1.3, 6, "2024/07/23 12:00:00", 192, 0, 113101, 450, "【物理】前衛で、流麗な太刀捌きを魅せる若夏の姉御。\nダメージを与えた回数に応じて攻撃力が高まるスキルと、\n携えた二刀の幾刃もの斬撃で、眼前の敵を薙ぎ払う。", 27, 113101, 27, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113201, 0, 2, 0, 0, 113201, 0, "アンナ（サマー）", "あんな", 0, 1, "2030/12/31 15:00:00", 1.625, 12, "2022/04/18 15:00:00", 256, 0, 113201, 450, "【魔法】前衛で皆の力を借り受け力を振るう真夏の冥姫。\n味方全体の魔法攻撃力を代償に自身の魔法攻撃力を劇的に\n高め、熾烈な攻撃魔法を繰り出し大ダメージを与える。", 5, 113201, 28, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113301, 0, 2, 0, 0, 113301, 0, "ナナカ（サマー）", "ななか", 0, 3, "2030/12/31 15:00:00", 2.07, 12, "2020/07/15 15:00:00", 468, 0, 113301, 450, "【魔法】中衛の多勢相手の戦いが得意な真夏の魔法少女。\n敵の数に応じて効果が上昇する防御力ダウンのスキルや、\n多彩な範囲攻撃を操り、真夏の戦いをサイカワに制する。", 7, 113301, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113401, 0, 2, 0, 0, 113401, 0, "ハツネ（サマー）", "はつね", 0, 3, "2024/07/31 11:59:59", 1.92, 12, "2024/07/23 12:00:00", 567, 0, 113401, 450, "【魔法】中衛から全体魔法攻撃を放つ超能力チアガール。\nユニオンバーストで敵全体に絶大な一撃を放ち、\nその後、超能力発動の反動で枕を抱えて夢の中へ。", 7, 113401, 29, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113501, 0, 2, 0, 0, 113501, 0, "ミサト（サマー）", "みさと", 0, 1, "2030/12/31 15:00:00", 2.07, 12, "2022/05/18 15:00:00", 697, 0, 113501, 450, "【魔法】後衛で、敵の脅威から生徒を守る夏女神な先生。\n味方の魔法防御力を高め、ＨＰを継続回復するスキルや、\nバリア展開のユニオンバーストで味方を堅固に守護する。", 7, 113501, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113601, 0, 1, 0, 0, 113601, 0, "ジュン（サマー）", "じゅん", 0, 3, "2030/12/31 15:00:00", 2.0, 12, "2020/08/15 15:00:00", 182, 0, 113601, 450, "【物理】前衛で、業火を従え悪を討つ真夏の騎士団長。\n敵単体にダメージを与えつつ、攻撃力を高めるユニオン\nバーストや、火傷を与えるスキルを操り敵を焼き尽くす。", 5, 113601, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113701, 0, 2, 0, 0, 113701, 0, "アカリ（エンジェル）", "あかり", 0, 3, "2030/12/31 15:00:00", 1.92, 12, "2020/09/03 19:00:00", 530, 0, 113701, 450, "【魔法】中衛で、魔法攻撃をお見舞いする双子の妹天使。\n効果時間が短い分、絶大な効果の強化魔法で自身の攻撃力\nを大きく高め、威力抜群の単体魔法で敵を一掃する。", 7, 113701, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113801, 0, 2, 0, 0, 113801, 0, "ヨリ（エンジェル）", "より", 0, 3, "2030/12/31 15:00:00", 2.34, 12, "2020/09/19 15:00:00", 531, 0, 113801, 450, "【魔法】中衛で、補助魔法で味方を助ける双子の姉天使。\n防御力を大幅に高めつつ、対象の味方に敵の注意を引か\nせるなど、特殊で強力なスキルを駆使し敵を翻弄する。", 6, 113801, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (113901, 0, 1, 0, 0, 113901, 0, "ツムギ（ハロウィン）", "つむぎ", 0, 3, "2023/10/26 11:59:59", 2.375, 12, "2023/10/23 12:00:00", 152, 0, 113901, 450, "【物理】前衛で敵の物理攻撃を妨害する吸血鬼テーラー。\n挑発と物理無効バリア、さらに最も物理攻撃力が高い敵を\n狙った妨害スキルによって、鉄壁の防御を織り上げる。", 2, 113901, 2, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114001, 0, 1, 0, 0, 114001, 0, "レイ（ハロウィン）", "れい", 0, 3, "2030/12/31 15:00:00", 1.965, 12, "2020/10/15 15:00:00", 375, 0, 114001, 450, "【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。", 4, 114001, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114101, 0, 1, 0, 0, 114101, 0, "マツリ（ハロウィン）", "まつり", 0, 1, "2030/12/31 15:00:00", 2.295, 12, "2022/07/19 8:00:00", 186, 0, 114101, 450, "【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。", 1, 114101, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114201, 0, 1, 0, 0, 114201, 0, "モニカ（マジカル）", "もにか", 0, 3, "2030/12/31 15:00:00", 2.24, 12, "2020/10/31 12:00:00", 528, 0, 114201, 450, "【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。", 4, 114201, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114301, 0, 1, 0, 0, 114301, 0, "トモ（マジカル）", "とも", 0, 3, "2030/12/31 15:00:00", 2.0, 2, "2020/11/21 15:00:00", 402, 0, 114301, 450, "【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。", 4, 114301, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114401, 0, 1, 0, 0, 114401, 0, "アキノ（クリスマス）", "あきの", 0, 3, "2023/12/27 11:59:59", 2.0, 2, "2023/12/22 12:00:00", 189, 0, 114401, 450, "【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。", 5, 114401, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114501, 0, 1, 0, 0, 114501, 0, "サレン（クリスマス）", "されん", 0, 3, "2030/12/31 15:00:00", 2.09, 3, "2020/12/21 15:00:00", 150, 0, 114501, 450, "【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。", 4, 114501, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114601, 0, 1, 0, 0, 114601, 0, "ユカリ（クリスマス）", "ゆかり", 0, 1, "2030/12/31 15:00:00", 2.09, 2, "2022/09/17 15:00:00", 408, 0, 114601, 450, "【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。", 5, 114601, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (114701, 0, 1, 0, 0, 114701, 0, "ムイミ（ニューイヤー）", "むいみ", 0, 1, "2030/12/31 15:00:00", 2.0, 2, "2022/10/16 15:00:00", 138, 0, 114701, 450, "【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。", 2, 114701, 31, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (115001, 0, 2, 0, 0, 115001, 0, "ネネカ（ニューイヤー）", "ねねか", 0, 3, "2024/01/31 11:59:59", 2.07, 2, "2024/01/26 12:00:00", 562, 0, 115001, 450, "【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。", 7, 115001, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (115501, 0, 1, 0, 0, 115501, 0, "コッコロ（儀装束）", "こっころ", 0, 3, "2024/01/26 11:59:59", 2.0, 1, "2024/01/22 12:00:00", 533, 0, 115501, 450, "【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。", 2, 115501, 2, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (115601, 0, 2, 0, 0, 115601, 0, "ユイ（儀装束）", "ゆい", 0, 1, "2030/12/31 15:00:00", 1.97, 7, "2022/11/17 15:00:00", 578, 0, 115601, 450, "【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。", 7, 115601, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (115701, 0, 2, 0, 0, 115701, 0, "カスミ（サマー）", "かすみ", 0, 3, "2030/12/31 15:00:00", 2.27, 9, "2021/02/23 15:00:00", 738, 0, 115701, 450, "【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。", 7, 115701, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (115801, 0, 1, 0, 116101, 115801, 0, "リマ（シンデレラ）", "りま", 0, 1, "2030/12/31 15:00:00", 2.27, 5, "2022/12/19 15:00:00", 173, 0, 115801, 450, "【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。", 4, 115801, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (115901, 0, 1, 0, 0, 115901, 0, "マコト（シンデレラ）", "まこと", 0, 3, "2030/12/31 15:00:00", 2.27, 4, "2021/03/03 19:00:00", 166, 0, 115901, 450, "【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。", 5, 115901, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116001, 0, 2, 0, 0, 116001, 0, "マホ（シンデレラ）", "まほ", 0, 3, "2030/12/31 15:00:00", 2.27, 9, "2021/03/22 15:00:00", 645, 0, 116001, 450, "【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。", 7, 116001, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116201, 0, 1, 0, 0, 116201, 0, "クロエ（聖学祭）", "くろえ", 0, 3, "2030/12/31 15:00:00", 2.125, 2, "2021/04/15 15:00:00", 184, 0, 116201, 450, "【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n特定回数ダメージを与えるたびＴＰを全回復するスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。", 2, 116201, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116301, 0, 1, 0, 0, 116301, 0, "チエル（聖学祭）", "ちえる", 0, 3, "2030/12/31 15:00:00", 2.295, 2, "2021/03/31 12:00:00", 223, 0, 116301, 450, "【物理】前衛で聖学祭を盛りアゲる、はぴちぇる系女子。\n攻撃ヒットのたびに【ちぇる】を貯め、威力が増すスキル\nと味方全体の物理攻撃力アップ効果のＵＢで勝利に導く。", 1, 116301, 32, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116401, 0, 2, 0, 0, 116401, 0, "ユニ（聖学祭）", "ゆに", 0, 3, "2030/12/31 15:00:00", 2.27, 2, "2022/02/08 12:00:00", 808, 0, 116401, 450, "【魔法】後衛から、仲間を啓蒙するユニちゃんズの才媛。\n自分以外の味方全員の物理・魔法両方の攻撃力アップと\nクリティカル時のダメージアップで皆を勝利へと導く。", 7, 116401, 39, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116501, 0, 1, 0, 0, 116501, 0, "イノリ（タイムトラベル）", "いのり", 0, 3, "2030/12/31 15:00:00", 2.295, 17, "2021/04/30 12:00:00", 252, 0, 116501, 450, "【物理】前衛で威勢よく、まくしたてる口撃系ドラゴン。\n全体物理攻撃力アップのＵＢは、味方の防御力を下げる\n代わりにＨＰが多いほど効果を高め、味方を勝利に導く。", 3, 116501, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116601, 0, 1, 0, 0, 116601, 0, "カヤ（タイムトラベル）", "かや", 0, 3, "2030/12/31 15:00:00", 2.295, 17, "2021/05/21 15:00:00", 169, 0, 116601, 450, "【物理】前衛で味方を勝利にナビする喧嘩屋ドラゴン族。\nユニオンバーストで自身の攻撃速度を極大アップさせ、\n物理攻撃力アップスキルのシナジーで拳の雨を降らせる。", 1, 116601, 1, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116701, 0, 1, 0, 0, 116701, 0, "アオイ（作業服）", "あおい", 0, 3, "2030/12/31 15:00:00", 1.82, 9, "2021/05/31 12:00:00", 527, 0, 116701, 450, "【物理】中衛で敵を妨害する、作業服姿のぼっちエルフ。\n友情の絆で結ばれた『マイフレンドくん』と放つＵＢは、\n敵の動きを阻み、物理防御力を劇的に下げる。", 33, 116701, 33, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116801, 0, 1, 0, 0, 116801, 0, "タマキ（作業服）", "たまき", 0, 1, "2030/12/31 15:00:00", 2.295, 8, "2023/03/16 15:00:00", 216, 0, 116801, 450, "【物理】前衛でたい焼き器片手に悪を討つ売り子の猫娘。\n味方全体を物理攻撃力アップとＴＰ回復させ、ＵＢでさら\nに自分の攻撃力を特大強化し、驚異の威力を発揮する。", 2, 116801, 2, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (116901, 0, 1, 0, 0, 116901, 0, "ミフユ（作業服）", "みふゆ", 0, 3, "2030/12/31 15:00:00", 2.065, 8, "2021/06/16 15:00:00", 275, 0, 116901, 450, "【物理】前衛で、皆の盾となり進攻するバイトリーダー。\nバトル序盤は物理の攻防両方をスキルで強化。ＵＢ発動毎\nに自分のクリティカルをアップし猛烈な攻撃を繰り出す。", 6, 116901, 6, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117001, 0, 1, 0, 0, 117001, 0, "エリコ（サマー）", "えりこ", 0, 3, "2023/08/31 11:59:59", 1.55, 11, "2023/08/26 12:00:00", 407, 0, 117001, 450, "【物理】中衛で、火花を纏い夕闇を彩る真夏の壊し屋。\n二つのスキルで物理防御力を下げ、ダメージ量に応じて\nクリティカル上昇が延長するＵＢで眼前の敵を粉砕する。", 3, 117001, 3, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117101, 0, 1, 0, 0, 117101, 0, "シズル（サマー）", "しずる", 0, 3, "2030/12/31 15:00:00", 2.0, 6, "2021/07/15 12:00:00", 163, 0, 117101, 450, "【物理】前衛で、堅牢に仲間を守る海辺のお姉ちゃん。\n物理防御力が高い程、効果が高まる複数のスキルを巧みに\n操り防御と補助役をしつつ範囲攻撃で攻撃役をもこなす。", 5, 117101, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117201, 0, 1, 0, 0, 117201, 0, "ノゾミ（サマー）", "のぞみ", 0, 3, "2023/08/31 11:59:59", 2.09, 10, "2023/08/26 12:00:00", 417, 0, 117201, 450, "【物理】中衛でみんなを応援する真夏のトップアイドル。\nすべてのスキルで味方全体の物理攻撃をサポートし、\nバトル中盤から味方全体のＴＰ回復で、皆を勝利に導く。", 4, 117201, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117301, 0, 2, 0, 0, 117301, 0, "チカ（サマー）", "ちか", 0, 3, "2030/12/31 15:00:00", 2.07, 10, "2021/08/15 15:00:00", 520, 0, 117301, 450, "【魔法】中衛で、守護の賛歌を捧げる夏海の歌姫。\n最序盤に味方の魔法防御を大幅に強化し、吸収バリアや\nＨＰ回復スキルで、如何なる猛攻からも味方を守る。", 7, 117301, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117401, 0, 1, 0, 0, 117401, 0, "ツムギ（サマー）", "つむぎ", 0, 1, "2030/12/31 15:00:00", 2.42, 10, "2023/05/16 15:00:00", 355, 0, 117401, 450, "【物理】中衛で敵を引き寄せ陣形を崩す夕凪のテーラー。\n最も攻撃力の高い敵を、敵陣から自陣に引き寄せつつ\n束縛や行動速度ダウンを絡めたスキルで敵の自由を縛る。", 1, 117401, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117501, 0, 1, 0, 0, 117501, 0, "ミツキ（オーエド）", "みつき", 0, 3, "2030/12/31 15:00:00", 2.4, 11, "2021/09/03 19:00:00", 552, 0, 117501, 450, "【物理】中衛で、戦況のすべてを見据える隻眼の闇医者。\nＨＰが低い敵を束縛し防御力ダウンスキルで仕掛けつつ\n呪詛の毎秒増加する継続ダメージで敵の命を刻々と蝕む。", 5, 117501, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117601, 0, 2, 0, 0, 117601, 0, "ユキ（オーエド）", "ゆき", 0, 3, "2030/12/31 15:00:00", 2.0, 12, "2021/09/13 12:00:00", 798, 0, 117601, 450, "【魔法】後衛で、迷える皆を救う白衣を纏いし美の象徴。\n一番低い味方１キャラのＴＰを回復し、ＨＰ回復スキルで\n守り、魔法攻撃力アップのスキルで一気に攻め落とす。", 7, 117601, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117701, 0, 1, 0, 0, 117701, 0, "カオリ（ハロウィン）", "かおり", 0, 3, "2023/10/26 11:59:59", 2.17, 4, "2023/10/23 12:00:00", 156, 0, 117701, 450, "【物理】前衛の敵を追い詰める程、力を増す幽玄南国娘。\n敵の体力が少ない程、効果が高まる攻撃力アップスキルと\nダメージ量アップの攻撃スキルで、敵を逃さず仕留める。", 1, 117701, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117801, 0, 1, 0, 0, 117801, 0, "ニノン（ハロウィン）", "にのん", 0, 1, "2030/12/31 15:00:00", 2.25, 12, "2023/07/18 15:00:00", 518, 0, 117801, 450, "【物理】中衛で物理攻撃タイプの味方を強化するシノビ。\n味方の物理攻撃力アップや行動速度アップのスキル効果で\n味方全体の攻撃力を底上げし、勝利の笛を吹きならす。", 36, 117801, 36, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (117901, 0, 1, 0, 0, 117901, 0, "スズナ（ハロウィン）", "すずな", 0, 3, "2030/12/31 15:00:00", 1.97, 15, "2021/10/15 15:00:00", 761, 0, 117901, 450, "【物理】後衛でアタッカーを狙う小悪魔カリスマモデル。\n誘惑状態だと威力アップの攻撃スキルや、ＴＰを奪い取る\n妨害スキルを放ち、物理攻撃力が最も高い敵を狙い撃つ。", 8, 117901, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (118001, 0, 1, 0, 0, 118001, 0, "クレジッタ", "くれじった", 0, 3, "2023/09/15 14:59:59", 1.97, 0, "2023/09/12 12:00:00", 751, 0, 118001, 450, "【物理】後衛で、攻撃と敵の弱体化の二役で輝く女商人。\n生ける金貨が詰まった財布を投げつける不意打ちや、\n金貨の嵐を巻き起こす攻撃で、相手の防御を大きく崩す。", 35, 118001, 35, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (118101, 0, 2, 0, 0, 118101, 0, "ランファ", "らんふぁ", 0, 3, "2024/07/03 18:59:59", 2.07, 19, "2024/06/30 12:00:00", 782, 0, 118101, 450, "【魔法】後衛で、美しい旋律を紡ぎ支援する幽寂の歌姫。\n味方の強化と敵の弱体化の両方面での補助を行い、さらに\n召喚した鉱石の飛竜との波状攻撃により敵を鎮圧する。", 7, 118101, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (118201, 0, 2, 0, 0, 118201, 0, "ミソラ", "みそら", 0, 3, "2024/07/03 18:59:59", 1.7, 19, "2024/06/30 12:00:00", 730, 0, 118201, 450, "【魔法】後衛で笑顔とともに破壊を振りまく溌溂少女★\n最大３体に着弾するスキルとＵＢは【PSI★チャージ】\n状態で魔防ダウン効果を追加し、邪魔者たちを殲滅する。", 0, 118201, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (118301, 0, 0, 180701, 0, 118301, 0, "ハツネ（ハツネ&シオリ）", "はつね", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 732, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (118401, 0, 0, 180701, 0, 118401, 0, "シオリ（ハツネ&シオリ）", "しおり", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 732, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (118501, 0, 2, 0, 0, 118501, 0, "カリン", "かりん", 0, 1, "2030/12/31 15:00:00", 2.0, 0, "2021/10/19 12:00:00", 787, 0, 118501, 450, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 37, 118501, 37, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119001, 0, 2, 0, 0, 119001, 0, "イオ（ノワール）", "いお", 0, 3, "2030/12/31 15:00:00", 2.27, 15, "2021/11/03 19:00:00", 714, 0, 119001, 450, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 7, 119001, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119101, 0, 2, 0, 0, 119101, 0, "クウカ（ノワール）", "くうか", 0, 3, "2030/12/31 15:00:00", 2.545, 12, "2021/11/16 12:00:00", 143, 0, 119101, 450, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 7, 119101, 26, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119201, 0, 1, 0, 0, 119201, 0, "マヒル（クリスマス）", "まひる", 0, 1, "2030/12/31 15:00:00", 2.19, 5, "2023/09/19 15:00:00", 397, 0, 119201, 450, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 6, 119201, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119301, 0, 1, 0, 0, 119301, 0, "リノ（クリスマス）", "りの", 0, 3, "2030/12/31 15:00:00", 1.97, 6, "2021/12/22 12:00:00", 762, 0, 119301, 450, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 8, 119301, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119401, 0, 0, 0, 0, 119401, 0, "ぺコリーヌ", "ぺこりーぬ", 0, 1, "2030/12/31 15:00:00", 0.0, 0, "2022/01/31 12:00:00", 0, 0, 0, 0, "", 5, 0, 0, 0);
