INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119601, 0, 0, 0, 0, 119601, 0, "キャル", "きゃる", 0, 1, "2030/12/31 15:00:00", 0.0, 0, "2022/01/31 12:00:00", 0, 0, 0, 0, "", 7, 0, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119701, 0, 0, 0, 0, 119701, 0, "シェフィ", "しぇふぃ", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2022/01/31 12:00:00", 0, 0, 0, 0, "", 4, 0, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (119901, 0, 1, 0, 0, 119901, 0, "ミヤコ（クリスマス）", "みやこ", 0, 3, "2023/12/27 11:59:59", 2.17, 14, "2023/12/22 12:00:00", 302, 0, 119901, 450, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 1, 119901, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (120001, 0, 1, 0, 0, 120001, 0, "シズル（ノワール）", "しずる", 0, 3, "2024/03/28 11:59:59", 2.375, 6, "2024/03/22 12:00:00", 190, 0, 120001, 450, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 5, 120001, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (120101, 0, 0, 0, 0, 120101, 0, "イオ（ノワール）", "いお", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 7, 0, 7, 0);
