INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (120601, 0, 0, 180801, 0, 120601, 0, "キョウカ（リトルリリカル）", "きょうか", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 465, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (120701, 0, 1, 0, 0, 120701, 0, "シェフィ（ニューイヤー）", "しぇふぃ", 0, 3, "2024/01/31 11:59:59", 1.84, 1, "2024/01/26 12:00:00", 283, 0, 120701, 450, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 4, 120701, 22, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (120801, 0, 1, 0, 0, 120801, 0, "ルカ（ニューイヤー）", "るか", 0, 1, "2030/12/31 15:00:00", 1.3, 2, "2023/10/16 15:00:00", 193, 0, 120801, 450, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 4, 120801, 22, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (120901, 0, 2, 0, 0, 120901, 0, "イリヤ（ニューイヤー）", "いりや", 0, 3, "2024/01/31 11:59:59", 1.425, 12, "2024/01/26 12:00:00", 424, 0, 120901, 450, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 3, 120901, 38, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121001, 0, 1, 0, 0, 121001, 0, "ペコリーヌ（オーバーロード）", "ぺこりーぬ", 0, 3, "2024/02/29 11:59:59", 2.25, 1, "2024/02/22 12:00:00", 164, 0, 121001, 450, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 5, 121001, 41, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121101, 0, 2, 0, 0, 121101, 0, "キャル（オーバーロード）", "きゃる", 0, 3, "2024/02/29 11:59:59", 2.07, 1, "2024/02/22 12:00:00", 588, 0, 121101, 450, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 7, 121101, 42, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121201, 0, 1, 0, 0, 121201, 0, "ラビリスタ（オーバーロード）", "らびりすた", 0, 1, "2030/12/31 15:00:00", 1.55, 6, "2023/11/16 15:00:00", 260, 0, 121201, 450, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 4, 121201, 40, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121301, 0, 1, 0, 0, 121301, 0, "クルミ（ステージ）", "くるみ", 0, 3, "2030/12/31 15:00:00", 1.9, 3, "2022/03/03 19:00:00", 731, 0, 121301, 450, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 121301, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121401, 0, 2, 0, 0, 121401, 0, "ミサキ（ステージ）", "みさき", 0, 3, "2030/12/31 15:00:00", 2.27, 15, "2022/03/15 15:00:00", 742, 0, 121401, 450, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 121401, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121501, 0, 1, 0, 0, 121501, 0, "アユミ（怪盗）", "あゆみ", 0, 3, "2024/04/15 14:59:59", 2.0, 12, "2024/04/12 12:00:00", 590, 0, 121501, 450, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 121501, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121601, 0, 1, 0, 0, 121601, 0, "イノリ（怪盗）", "いのり", 0, 3, "2030/12/31 15:00:00", 1.425, 17, "2022/04/15 15:00:00", 292, 0, 121601, 450, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 121601, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121701, 0, 0, 180901, 0, 121701, 0, "アキノ（アキノ＆サレン）", "あきの", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 421, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121801, 0, 0, 180901, 0, 121801, 0, "サレン（アキノ＆サレン）", "されん", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 421, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (121901, 0, 2, 0, 0, 121901, 0, "アンナ（パイレーツ）", "あんな", 0, 3, "2030/12/31 15:00:00", 2.125, 12, "2022/05/15 15:00:00", 293, 0, 121901, 450, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 5, 121901, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122001, 0, 1, 0, 0, 122001, 0, "シノブ（パイレーツ）", "しのぶ", 0, 3, "2030/12/31 15:00:00", 1.425, 14, "2022/05/03 19:00:00", 380, 0, 122001, 450, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 122001, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122101, 0, 1, 0, 0, 122101, 0, "アオイ（キャンプ）", "あおい", 0, 1, "2030/12/31 15:00:00", 1.97, 9, "2024/04/18 15:00:00", 731, 0, 122101, 450, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 122101, 35, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122201, 0, 1, 0, 0, 122201, 0, "ユカリ（キャンプ）", "ゆかり", 0, 3, "2030/12/31 15:00:00", 1.84, 8, "2022/05/31 12:00:00", 419, 0, 122201, 450, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 4, 122201, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122301, 0, 2, 0, 0, 122301, 0, "ヴァンピィ", "うぁんぴぃ", 0, 3, "2030/12/31 15:00:00", 1.425, 0, "2022/06/15 15:00:00", 564, 0, 122301, 450, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 122301, 43, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122401, 0, 1, 0, 0, 122401, 0, "ヒヨリ（サマー）", "ひより", 0, 1, "2030/12/31 15:00:00", 2.42, 8, "2024/06/17 15:00:00", 264, 0, 122401, 450, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 122401, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122501, 0, 1, 0, 0, 122501, 0, "レイ（サマー）", "れい", 0, 3, "2023/07/15 14:59:59", 1.965, 0, "2023/07/12 12:00:00", 250, 0, 122501, 450, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 4, 122501, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122601, 0, 2, 0, 0, 122601, 0, "ユイ（サマー）", "ゆい", 0, 3, "2030/12/31 15:00:00", 2.27, 0, "2022/07/15 15:00:00", 554, 0, 122601, 450, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 7, 122601, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122701, 0, 2, 0, 0, 122701, 0, "キョウカ（サマー）", "きょうか", 0, 3, "2030/12/31 15:00:00", 1.92, 0, "2022/08/15 15:00:00", 812, 0, 122701, 450, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 122701, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122801, 0, 1, 0, 0, 122801, 0, "ミソギ（サマー）", "みそぎ", 0, 1, "2030/12/31 15:00:00", 2.295, 0, "2024/07/16 15:00:00", 237, 0, 122801, 450, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 122801, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (122901, 0, 1, 0, 0, 122901, 0, "ミミ（サマー）", "みみ", 0, 3, "2023/08/12 11:59:59", 2.25, 0, "2023/08/09 12:00:00", 361, 0, 122901, 450, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 122901, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123001, 0, 2, 0, 0, 123001, 0, "アメス", "あめす", 0, 3, "2024/07/03 18:59:59", 2.27, 0, "2024/06/30 12:00:00", 746, 0, 123001, 450, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 44, 123001, 44, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123101, 0, 2, 0, 0, 123101, 0, "マホ（エクスプローラー）", "まほ", 0, 3, "2030/12/31 15:00:00", 1.795, 0, "2022/09/03 19:00:00", 793, 0, 123101, 450, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 123101, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123201, 0, 1, 0, 0, 123201, 0, "アヤネ（エクスプローラー）", "あやね", 0, 3, "2030/12/31 15:00:00", 1.425, 0, "2022/09/15 15:00:00", 256, 0, 123201, 450, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 123201, 3, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123301, 0, 1, 0, 0, 123301, 0, "ネア", "ねあ", 0, 3, "2023/09/15 14:59:59", 1.62, 0, "2023/09/12 12:00:00", 350, 0, 123301, 450, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 1, 123301, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123401, 0, 0, 0, 0, 123401, 0, "ジュン（キャンプ）", "じゅん", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 5, 0, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123501, 0, 1, 0, 0, 123501, 0, "リン（ハロウィン）", "りん", 1, 1, "2030/12/31 15:00:00", 2.34, 0, "2022/09/30 12:00:00", 583, 0, 123501, 450, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 6, 123501, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123601, 0, 1, 0, 0, 123601, 0, "トモ（ハロウィン）", "とも", 0, 3, "2023/10/15 14:59:59", 1.965, 0, "2023/10/10 12:00:00", 262, 0, 123601, 450, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 4, 123601, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123701, 0, 2, 0, 0, 123701, 0, "ナナカ（ハロウィン）", "ななか", 0, 3, "2030/12/31 15:00:00", 2.07, 0, "2022/10/15 15:00:00", 741, 0, 123701, 450, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 7, 123701, 21, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123801, 0, 1, 0, 0, 123801, 0, "クリスティーナ（ワイルド）", "くりすてぃーな", 0, 3, "2023/11/15 14:59:59", 2.295, 0, "2023/11/10 12:00:00", 238, 0, 123801, 450, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 123801, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (123901, 0, 1, 0, 0, 123901, 0, "マツリ（ワイルド）", "まつり", 0, 3, "2030/12/31 15:00:00", 2.125, 0, "2022/11/15 15:00:00", 183, 0, 123901, 450, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2, 123901, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124001, 0, 2, 0, 0, 124001, 0, "アカリ（クリスマス）", "あかり", 0, 3, "2023/12/15 14:59:59", 2.07, 0, "2023/12/11 12:00:00", 438, 0, 124001, 450, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 7, 124001, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124101, 0, 2, 0, 0, 124101, 0, "ヨリ（クリスマス）", "より", 1, 1, "2030/12/31 15:00:00", 1.965, 0, "2022/11/30 12:00:00", 433, 0, 124101, 450, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 6, 124101, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124201, 0, 1, 0, 0, 124201, 0, "ジュン（クリスマス）", "じゅん", 0, 3, "2030/12/31 15:00:00", 2.07, 0, "2022/12/23 12:00:00", 144, 0, 124201, 450, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 5, 124201, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124301, 0, 0, 181001, 0, 124301, 0, "アン（アン＆グレア）", "あん", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 577, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124401, 0, 0, 181001, 0, 124401, 0, "グレア（アン＆グレア）", "ぐれあ", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 577, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124501, 0, 2, 0, 0, 124501, 0, "ホマレ（ニューイヤー）", "ほまれ", 0, 3, "2024/01/15 14:59:59", 2.07, 0, "2024/01/12 12:00:00", 707, 0, 124501, 450, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 7, 124501, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124601, 0, 2, 0, 0, 124601, 0, "ミサト（ニューイヤー）", "みさと", 0, 3, "2024/01/15 14:59:59", 2.44, 0, "2024/01/12 12:00:00", 698, 0, 124601, 450, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 7, 124601, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124701, 0, 1, 0, 0, 124701, 0, "ミツキ（ニューイヤー）", "みつき", 1, 1, "2030/12/31 15:00:00", 2.24, 0, "2022/12/31 12:00:00", 590, 0, 124701, 450, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 7, 124701, 46, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124801, 0, 1, 0, 0, 124801, 0, "ノゾミ（リベレイター）", "のぞみ", 0, 3, "2024/02/14 23:59:59", 2.14, 0, "2024/02/12 12:00:00", 423, 0, 124801, 450, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 4, 124801, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (124901, 0, 1, 0, 0, 124901, 0, "カヤ（リベレイター）", "かや", 1, 1, "2030/12/31 15:00:00", 1.965, 0, "2023/01/31 12:00:00", 170, 0, 124901, 450, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 1, 124901, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125001, 0, 1, 0, 0, 125001, 0, "ムイミ（リベレイター）", "むいみ", 0, 3, "2024/02/14 23:59:59", 1.965, 0, "2024/02/12 12:00:00", 221, 0, 125001, 450, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 5, 125001, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125101, 0, 1, 0, 0, 125101, 0, "タマキ（カフェ）", "たまき", 0, 3, "2030/12/31 15:00:00", 2.24, 0, "2023/03/03 19:00:00", 825, 0, 125101, 450, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 8, 125101, 47, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125201, 0, 1, 0, 0, 125201, 0, "モニカ（カフェ）", "もにか", 0, 3, "2030/12/31 15:00:00", 1.965, 0, "2023/03/10 12:00:00", 463, 0, 125201, 450, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 125201, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125301, 0, 1, 0, 0, 125301, 0, "コッコロ（レンジャー）", "こっころ", 0, 3, "2024/04/15 14:59:59", 2.07, 0, "2024/04/12 12:00:00", 752, 0, 125301, 450, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 125301, 6, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125401, 0, 1, 0, 0, 125401, 0, "シオリ（レンジャー）", "しおり", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2023/04/10 12:00:00", 710, 0, 125401, 450, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 125401, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125501, 0, 2, 0, 0, 125501, 0, "ジータ（ウォーロック）", "じーた", 0, 3, "2024/05/15 14:59:59", 1.92, 0, "2024/05/10 12:00:00", 443, 0, 125501, 450, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 7, 125501, 50, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125601, 0, 1, 0, 0, 125601, 0, "ビカラ", "びから", 0, 3, "2024/05/15 14:59:59", 2.09, 0, "2024/05/10 12:00:00", 267, 0, 125601, 450, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 51, 125601, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125701, 0, 2, 0, 0, 125701, 0, "カリン（アルケミスト）", "かりん", 1, 1, "2030/12/31 15:00:00", 2.24, 0, "2023/04/30 12:00:00", 579, 0, 125701, 450, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 7, 125701, 9, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125801, 0, 1, 0, 0, 125801, 0, "リリ（フォールン）", "りり", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2023/04/17 12:00:00", 464, 0, 125801, 450, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 3, 125801, 0, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (125901, 0, 0, 0, 0, 125901, 0, "カヤ（リベレイター）", "かや", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 1, 0, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126001, 0, 1, 0, 0, 126001, 0, "クリア（フォールン）", "くりあ", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2023/10/31 12:00:00", 406, 0, 126001, 450, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 126001, 0, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126101, 0, 2, 0, 0, 126101, 0, "プレシア（フォールン）", "ぷれしあ", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2023/11/15 15:00:00", 480, 0, 126101, 450, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 44, 126101, 53, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126201, 0, 2, 0, 0, 126201, 0, "イリヤ（儀装束）", "いりや", 0, 3, "2024/06/15 14:59:59", 2.09, 0, "2024/06/10 12:00:00", 568, 0, 126201, 450, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 126201, 3, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126301, 0, 2, 0, 0, 126301, 0, "ユキ（儀装束）", "ゆき", 0, 3, "2030/12/31 15:00:00", 2.07, 0, "2023/06/15 15:00:00", 456, 0, 126301, 450, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 7, 126301, 9, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126401, 0, 1, 0, 0, 126401, 0, "クローチェ", "くろーちぇ", 0, 3, "2024/07/03 18:59:59", 2.09, 0, "2024/06/30 12:00:00", 373, 0, 126401, 450, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 126401, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126501, 0, 2, 0, 0, 126501, 0, "ライラエル", "らいらえる", 0, 3, "2024/07/03 18:59:59", 1.965, 0, "2024/06/30 12:00:00", 740, 0, 126501, 450, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 7, 126501, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126601, 0, 2, 0, 0, 126601, 0, "ネネカ（サマー）", "ねねか", 0, 3, "2024/07/15 14:59:59", 2.04, 0, "2024/07/11 12:00:00", 650, 0, 126601, 450, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 126601, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126701, 0, 1, 0, 0, 126701, 0, "アキノ（サマー）", "あきの", 1, 1, "2030/12/31 15:00:00", 1.965, 0, "2023/06/30 12:00:00", 224, 0, 126701, 450, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 126701, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126801, 0, 1, 0, 0, 126801, 0, "ユカリ（サマー）", "ゆかり", 0, 3, "2030/12/31 15:00:00", 1.97, 0, "2023/07/15 15:00:00", 159, 0, 126801, 450, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 126801, 5, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (126901, 0, 2, 0, 0, 126901, 0, "ランファ（サマー）", "らんふぁ", 0, 3, "2024/08/12 11:59:59", 1.965, 0, "2024/08/09 12:00:00", 682, 0, 126901, 450, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 7, 126901, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127001, 0, 1, 0, 0, 127001, 0, "クウカ（サマー）", "くうか", 1, 1, "2023/08/14 20:59:59", 1.97, 0, "2023/07/31 12:00:00", 133, 0, 127001, 450, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 2, 127001, 52, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127101, 0, 1, 0, 0, 127101, 0, "シノブ（サマー）", "しのぶ", 0, 3, "2024/08/12 11:59:59", 2.09, 0, "2024/08/09 12:00:00", 255, 0, 127101, 450, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 5, 127101, 46, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127201, 0, 2, 0, 0, 127201, 0, "キャル（編入生）", "きゃる", 0, 3, "2024/03/31 11:59:59", 2.09, 0, "2024/03/28 12:00:00", 804, 0, 127201, 450, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 127201, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127301, 0, 1, 0, 0, 127301, 0, "スズナ（編入生）", "すずな", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2023/09/15 15:00:00", 750, 0, 127301, 450, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 127301, 8, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127401, 0, 0, 0, 0, 127401, 0, "ビカラ（コラボ）", "びから", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 1, 0, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127501, 0, 1, 0, 0, 127501, 0, "サレン（サラサリア）", "されん", 0, 3, "2024/04/30 11:59:59", 2.09, 0, "2024/04/26 12:00:00", 304, 0, 127501, 450, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 127501, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127601, 0, 1, 0, 0, 127601, 0, "ルカ（サラサリア）", "るか", 0, 3, "2030/12/31 15:00:00", 1.965, 0, "2023/10/15 15:00:00", 157, 0, 127601, 450, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 127601, 4, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (127901, 0, 2, 0, 0, 127901, 0, "ペコリーヌ（クリスマス）", "ぺこりーぬ", 0, 3, "2024/05/31 11:59:59", 1.965, 0, "2024/05/27 12:00:00", 372, 0, 127901, 450, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 127901, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128001, 0, 1, 0, 0, 128001, 0, "クレジッタ（クリスマス）", "くれじった", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2023/12/15 15:00:00", 723, 0, 128001, 450, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 35, 128001, 35, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128101, 0, 0, 181101, 0, 128101, 0, "シズル（シズル&リノ）", "しずる", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 580, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128201, 0, 0, 181101, 0, 128201, 0, "リノ（シズル&リノ）", "りの", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 580, 0, 0, 0, "", 0, 0, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128301, 0, 1, 0, 0, 128301, 0, "イノリ（ニューイヤー）", "いのり", 1, 1, "2030/12/31 15:00:00", 2.09, 0, "2023/12/31 12:00:00", 191, 0, 128301, 450, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 3, 128301, 38, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128401, 0, 2, 0, 0, 128401, 0, "ハツネ（ニューイヤー）", "はつね", 0, 3, "2024/06/30 11:59:59", 2.09, 0, "2024/06/26 12:00:00", 801, 0, 128401, 450, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 7, 128401, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128501, 0, 2, 0, 0, 128501, 0, "カスミ（ニューイヤー）", "かすみ", 0, 3, "2024/06/30 11:59:59", 2.09, 0, "2024/06/26 12:00:00", 739, 0, 128501, 450, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 7, 128501, 21, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128601, 0, 0, 0, 0, 128601, 0, "リリ（フォールン）", "りり", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 1, 0, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128701, 0, 1, 0, 0, 128701, 0, "ヒヨリ（アストラル）", "ひより", 0, 3, "2024/08/15 14:59:59", 2.09, 0, "2024/08/12 12:00:00", 226, 0, 128701, 450, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 1, 128701, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128801, 0, 1, 0, 0, 128801, 0, "レイ（アストラル）", "れい", 1, 1, "2030/12/31 15:00:00", 1.965, 0, "2024/01/31 12:00:00", 194, 0, 128801, 450, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 4, 128801, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (128901, 0, 2, 0, 0, 128901, 0, "ユイ（アストラル）", "ゆい", 0, 3, "2024/08/15 14:59:59", 2.09, 0, "2024/08/12 12:00:00", 772, 0, 128901, 450, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 7, 128901, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129001, 0, 2, 0, 0, 129001, 0, "エリス", "えりす", 0, 3, "2024/07/03 18:59:59", 2.09, 0, "2024/06/30 12:00:00", 800, 0, 129001, 450, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 7, 129001, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129301, 0, 1, 0, 0, 129301, 0, "ユニ（ウィンター）", "ゆに", 0, 3, "2024/03/11 11:59:59", 2.09, 0, "2024/03/03 19:00:00", 708, 0, 129301, 450, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 7, 129301, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129401, 0, 1, 0, 0, 129401, 0, "クロエ（ウィンター）", "くろえ", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2024/03/18 12:00:00", 188, 0, 129401, 450, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2, 129401, 2, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129601, 0, 1, 0, 0, 129601, 0, "アネモネ", "あねもね", 0, 3, "2024/07/03 18:59:59", 2.09, 0, "2024/06/30 12:00:00", 550, 0, 129601, 450, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 129601, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129701, 0, 1, 0, 0, 129701, 0, "ネフィ＝ネラ", "ねふぃーねら", 0, 3, "2024/07/03 18:59:59", 2.09, 0, "2024/06/30 12:00:00", 540, 0, 129701, 450, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 129701, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129801, 0, 1, 0, 0, 129801, 0, "マコト（コマンダー）", "まこと", 0, 3, "2024/04/12 11:59:59", 2.09, 0, "2024/03/31 12:00:00", 269, 0, 129801, 450, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 5, 129801, 5, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (129901, 0, 1, 0, 0, 129901, 0, "エリコ（コマンダー）", "えりこ", 0, 3, "2030/12/31 15:00:00", 1.84, 0, "2024/04/15 15:00:00", 294, 0, 129901, 450, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 6, 129901, 48, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (130601, 0, 0, 0, 0, 130601, 0, "レイ（アストラル）", "れい", 0, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 4, 0, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (130701, 0, 2, 0, 0, 130701, 0, "キョウカ（スプリング）", "きょうか", 0, 3, "2024/05/15 14:59:59", 1.92, 0, "2024/05/03 19:00:00", 563, 0, 130701, 450, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 7, 130701, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (130801, 0, 2, 0, 0, 130801, 0, "スズメ（スプリング）", "すずめ", 0, 3, "2030/12/31 15:00:00", 1.84, 0, "2024/05/15 15:00:00", 558, 0, 130801, 450, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 7, 130801, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (130901, 0, 2, 0, 0, 130901, 0, "クルル", "くるる", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2024/06/15 15:00:00", 440, 0, 130901, 450, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 7, 130901, 7, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131001, 0, 2, 0, 0, 131001, 0, "マホ（ドリームパーク）", "まほ", 0, 3, "2024/06/10 11:59:59", 1.84, 0, "2024/05/31 12:00:00", 702, 0, 131001, 450, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 7, 131001, 7, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131101, 0, 1, 0, 0, 131101, 0, "ネア（サマー）", "ねあ", 0, 3, "2030/12/31 15:00:00", 2.09, 0, "2024/06/30 12:00:00", 165, 0, 131101, 450, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 2, 131101, 52, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131201, 0, 2, 0, 0, 131201, 0, "ミソラ（サマー）", "みそら", 0, 3, "2024/07/15 15:00:00", 2.09, 0, "2024/07/03 19:00:00", 753, 0, 131201, 450, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 35, 131201, 35, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131301, 0, 0, 0, 0, 131301, 0, "リリ", "りり", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 1, 0, 1, 1);
