INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131501, 0, 0, 0, 0, 131501, 0, "プレシア", "ぷれしあ", 1, 3, "2030/12/31 15:00:00", 0.0, 0, "2015/04/01 15:00:00", 0, 0, 0, 0, "", 1, 0, 1, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131601, 0, 1, 0, 0, 131601, 0, "リリ（サマー）", "りり", 0, 3, "2024/07/26 11:59:59", 1.92, 0, "2024/07/15 15:00:00", 399, 0, 131601, 450, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 4, 131601, 4, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (131701, 0, 2, 0, 0, 131701, 0, "アメス（サマー）", "あめす", 0, 3, "2024/08/12 11:59:59", 1.92, 0, "2024/07/31 12:00:00", 743, 0, 131701, 450, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 44, 131701, 53, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (170101, 0, 1, 0, 0, 170101, 0, "ジータ", "じーた", 0, 3, "2030/12/31 15:00:00", 1.965, 4, "2015/04/01 15:00:00", 245, 0, 170101, 450, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 34, 105701, 34, 0);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180101, 0, 1, 0, 0, 180101, 0, "ヒヨリ（プリンセス）", "ひより", 0, 3, "2024/07/03 18:59:59", 1.62, 7, "2024/06/30 12:00:00", 199, 0, 180101, 450, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 0, 180101, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180201, 0, 2, 0, 0, 180201, 0, "ユイ（プリンセス）", "ゆい", 0, 3, "2024/07/03 18:59:59", 1.92, 1, "2024/06/30 12:00:00", 767, 0, 180201, 450, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 0, 180201, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180301, 0, 1, 0, 0, 180301, 0, "レイ（プリンセス）", "れい", 0, 3, "2024/07/03 18:59:59", 1.965, 7, "2024/06/30 12:00:00", 377, 0, 180301, 450, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 0, 180301, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180401, 0, 1, 0, 0, 180401, 0, "ペコリーヌ（プリンセス）", "ぺこりーぬ", 0, 3, "2024/07/03 18:59:59", 1.965, 1, "2024/06/30 12:00:00", 155, 0, 180401, 450, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 0, 180401, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180501, 0, 1, 0, 0, 180501, 0, "コッコロ（プリンセス）", "こっころ", 0, 3, "2024/07/03 18:59:59", 2.14, 1, "2024/06/30 12:00:00", 555, 0, 180501, 450, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 0, 180501, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180601, 0, 2, 0, 0, 180601, 0, "キャル（プリンセス）", "きゃる", 0, 3, "2024/07/03 18:59:59", 1.92, 1, "2024/06/30 12:00:00", 747, 0, 180601, 450, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 0, 180601, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180701, 0, 1, 0, 0, 180701, 0, "ハツネ＆シオリ", "はつねしおり", 0, 3, "2024/07/03 18:59:59", 1.75, 1, "2024/06/30 12:00:00", 732, 0, 180701, 450, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 0, 180701, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180801, 0, 1, 0, 0, 180801, 0, "ミソギ＆ミミ＆キョウカ", "みそぎみみきょうか", 0, 3, "2024/07/03 18:59:59", 1.5, 1, "2024/06/30 12:00:00", 465, 0, 180801, 450, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 0, 180801, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (180901, 0, 1, 0, 0, 180901, 0, "アキノ＆サレン", "あきのされん", 0, 3, "2024/07/03 18:59:59", 2.09, 1, "2024/06/30 12:00:00", 421, 0, 180901, 450, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 0, 180901, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (181001, 0, 2, 0, 0, 181001, 0, "アン＆グレア", "あんぐれあ", 0, 3, "2024/07/03 18:59:59", 2.09, 1, "2024/06/30 12:00:00", 577, 0, 181001, 450, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 0, 181001, 0, 1);
INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (181101, 0, 1, 0, 0, 181101, 0, "シズル＆リノ", "しずるりの", 0, 3, "2024/07/03 18:59:59", 1.92, 1, "2024/06/30 12:00:00", 551, 0, 181101, 450, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 0, 181101, 0, 1);
