INSERT INTO `v1_50bf71078d3fee1ff018207fabe7d5aa369ee1b5a364794691c66cb435d363ae` VALUES (191301, 0, 1, 0, 0, 191301, 0, "カズマサ", "かずまさ", 0, 1, "2030/12/31 15:00:00", 2.22, 0, "2015/04/01 15:00:00", 850, 0, 191301, 450, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 6, 191301, 6, 1);
